// lib/blocs/log/bloc/system_log_event.dart
import '../../../base/base_bloc_event.dart';
import '../../../../modules/system_operation_also_main_module/models/system_component.dart';

sealed class SystemLogEvent extends BaseBlocEvent {
  SystemLogEvent() : super();
}

class LogEntryAdded extends SystemLogEvent {
  final String message;
  final ComponentStatus severity;

  LogEntryAdded({
    required this.message,
    required this.severity,
  });
}

class LogEntriesLoaded extends SystemLogEvent {
  final int limit;
  LogEntriesLoaded({this.limit = 1000});
}

class LogEntriesFiltered extends SystemLogEvent {
  final DateTime startDate;
  final DateTime endDate;
  final ComponentStatus? severityFilter;

  LogEntriesFiltered({
    required this.startDate,
    required this.endDate,
    this.severityFilter,
  });
}

class LogStreamStarted extends SystemLogEvent {}

class LogStreamStopped extends SystemLogEvent {}
